import CostItem from "./components/CostItem/CostItem";

const items  = [
  {
    name: "MacBook",
    date: "05.10.2023",
    price: "15000$"
  },
  {
    name: "Jacket",
    date: "06.10.2023",
    price: "3400$"
  },
  {
    name: "Iphone",
    date: "15.10.2023",
    price: "1500$"
  },
]


function App() {
  return (
    <>
      <h1>Let's start learn React!</h1>
      {
        items.map((item, itemIndex) => {
          <CostItem item={item} />
        })
      }

    </>
  );
}

export default App;
